<!DOCTYPE html>
<html lang="ko">

  <head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <meta name="apple-mobile-web-app-status-bar-style"
      content="black-translucent" />

    <meta name="theme-color" content="#e5e5e5" />
    <title>animations</title>
    <link rel="stylesheet" href="css/common.css" />

  </head>

  <body>
    <div id="page" class="ani-page">
      <header class="link-wrapper">
        <!-- ui.js -->
      </header>
      <main class="l-center">
        <p class="infomation">
          단독 애니메이션
        </p>
        <!-- animation -->
        <div class="ani-wrap ani-wrap1">
          <div class>
            <img src="image/icon_cloud.svg" alt class="dongdong" />
          </div>

          <div class>
            <img src="image/icon_phone.svg" alt class="ringring" />
          </div>

          <div class="arrow-wrap">
            <img src="image/icon_down.svg" alt class="down" />
          </div>
        </div>

        <p class="infomation">
          wrapper가 필요한 애니메이션
        </p>
        <!-- animation wave -->
        <div class="ani-wrap ani-wrap2">
          <div class="wave-wrap">
            <div class="wave wave1"></div>
            <div class="wave wave2"></div>
            <div class="wave wave3"></div>
          </div>
        </div>

        <!-- animation rotate -->
        <div class="ani-wrap ani-wrap3">
          <div class="rotate-wrapper">
            <div class="rotate-wrap">
              <div class="rotate-conts rotate-conts1">1</div>
              <div class="rotate-conts rotate-conts2">2</div>
              <div class="rotate-conts rotate-conts3">3</div>
              <div class="rotate-conts rotate-conts4">4</div>
              <div class="rotate-conts rotate-conts5">5</div>
              <div class="rotate-conts rotate-conts6">6</div>
              <div class="rotate-conts rotate-conts7">7</div>
              <div class="rotate-conts rotate-conts8">8</div>
            </div>
          </div>
        </div>

        <!-- animation circle -->
        <div class="ani-wrap ani-wrap4">
          <div class="circle-wrap">
            <div class="circle-grp">
              <div class="circle-conts">
                <img src="https://loremflickr.com/320/240" alt="임시이미지" />
              </div>
            </div>
          </div>
        </div>

        <!-- section firework -->
        <div class="ani-wrap ani-wrap5">
          <div class="stick-wrap">
            <div class="stick stick1">/</div>
            <div class="stick stick2">/</div>
            <div class="stick stick3">/</div>
            <div class="stick stick4">/</div>
            <div class="stick stick5">/</div>
            <div class="stick stick6">/</div>
            <div class="stick stick7">/</div>
            <div class="stick stick8">/</div>
          </div>
        </div>

        <!-- animation car dashboard -->
        <div class="ani-wrap ani-wrap6">
          <div class="loading-spinner">
            <span class="stick">-</span>
            <span class="voice-only">로딩중입니다</span>
          </div>
        </div>

        <!-- animation marquee -->
        <div class="ani-wrap ani-wrap7">
          <ul class="marquee-wrap">
            <li class="voice-only">inpix</li>
            <li class="voice-only">masstige</li>
            <li class="voice-only">designart</li>
            <li class="voice-only">slowalk</li>
            <li class="voice-only">+x</li>
          </ul>
        </div>
